import React from 'react';
import './index.css';

export const ButtonBar = (props) => {
    const { nextPressed, selectedOptionNumber } = props;
    return (
        <div className="buttonBarContainer">
            <button
                onClick={nextPressed}
                className="skipButton">
                Skip
            </button>
            <button
                onClick={nextPressed}
                className={selectedOptionNumber === 0 ? "nextButtonInactive" : "nextButton"}>
                Next
            </button>
        </div>
    )
}
